async function updateServiceStatusWithPingTime(e,t){try{var i=await(await fetch(t)).json(),r=parseFloat(i.ping_time),a=document.getElementById(e),u=a.querySelector("span"),s=a.querySelector("status-indicator");u.textContent=r+"ms",s.removeAttribute("positive"),s.removeAttribute("intermediary"),s.removeAttribute("negative"),r<35?s.setAttribute("positive",""):35<=r&&r<70?s.setAttribute("intermediary",""):s.setAttribute("negative","")}catch(t){console.error(`Error fetching data for ${e}:`,t)}}async function updateServiceStatusWithStatus(e,t){try{var i=(await(await fetch(t)).json()).status,r=document.getElementById(e),a=r.querySelector("span"),u=r.querySelector("status-indicator");a.textContent="",u.removeAttribute("positive"),u.removeAttribute("intermediary"),u.removeAttribute("negative"),"ok"===i?(a.textContent="Online",u.setAttribute("positive","")):"degraded"===i?(a.textContent="Limitált",u.setAttribute("intermediary","")):"error"===i?(a.textContent="Offline",u.setAttribute("negative","")):a.textContent="Ismeretlen állapot"}catch(t){console.error(`Error fetching data for ${e}:`,t)}}function initServices(){[{id:"service-1",url:"https://api.fxtelekom.org/status/cloudflare",updateFunction:updateServiceStatusWithPingTime},{id:"service-2",url:"https://api.fxtelekom.org/status/gcore",updateFunction:updateServiceStatusWithPingTime},{id:"service-3",url:"https://api.fxtelekom.org/status/valve-cs2",updateFunction:updateServiceStatusWithPingTime},{id:"service-4",url:"https://api.fxtelekom.org/status/tarkov",updateFunction:updateServiceStatusWithPingTime},{id:"service-5",url:"https://api.fxtelekom.org/status/websupportsk",updateFunction:updateServiceStatusWithPingTime},{id:"service-6",url:"https://api.fxtelekom.org/status/hunt",updateFunction:updateServiceStatusWithPingTime},{id:"service-7",url:"https://api.fxtelekom.org/status/service/wireguard",updateFunction:updateServiceStatusWithStatus},{id:"service-8",url:"https://api.fxtelekom.org/status/service/dns/1",updateFunction:updateServiceStatusWithStatus},{id:"service-9",url:"https://api.fxtelekom.org/status/service/dns/2",updateFunction:updateServiceStatusWithStatus},{id:"service-10",url:"https://api.fxtelekom.org/status/fastly",updateFunction:updateServiceStatusWithPingTime}].forEach(t=>{t.updateFunction(t.id,t.url)})}initServices(),setInterval(initServices,6e4);